import Styles from "./Container.module.css"

function CursosInCompany(){
    return (
    <section className={`${Styles.container}`}>
        
            <div>
                <h1>MBA em Liderança e Inovação na Gestão de Projetos 4.0</h1>
                <p>O MBA em Liderança e Inovação na Gestão de Projetos 4.0 é um curso de pós-graduação completo e atualizado, que proporciona aos alunos conhecimentos essenciais para liderar e inovar em projetos de forma estratégica e eficiente. Este curso é ideal para profissionais que desejam se destacar no mercado de trabalho e assumir posições de liderança na gestão de projetos.</p>
                
                <video><iframe width="560" height="315" src="https://www.youtube.com/embed/D9_HV3fC7to?si=xC0Qr_nsBAerqwMc" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe></video>
            </div>


    
        
    
    
    </section>
    )
    }
export default CursosInCompany
